class SOfN<T>(val n: Int) {
    private val sample = ArrayList<T>(n)
    private var i = 0
 
    fun process(item: T): List<T> {
        if (++i <= n)
            sample.add(item)
        else if (rand.nextInt(i) < n)
            sample[rand.nextInt(n)] = item
        return sample
    }
}
 
